                <p>LONG: </p>
                <p>MENSAGEM: </p>
        {/* {data.map((p) => {
          return (
            <div>
              <p>{p.id}</p>
            </div>
          );
        })} */}
      </div>
    </div>
  );
};

export default Acidentes;
